import { SingInStyle } from './styles'

function SingIn() {
    return (
        <SingInStyle>
            <div className="menu">
                <h1>Soccer<span>Maganer</span></h1>

                <div className="form">
                    <h2>Cadastrar-se</h2>

                    <input type="text" placeholder="Username"/>
                    <input type="email" placeholder="E-mail" />
                    <input type="password" placeholder="Password"/>

                    <button>Logar</button>

                </div>

            </div>
        </SingInStyle>
    );
}

export default SingIn;
